function buildHtml(a){return"<!DOCTYPE html><html><header></header><body></body></html>"}var fs=require("fs"),fileName=eval(fs.readFileSync("./portfolio.js")+"");stream.once("open",function(a){var b=buildHtml();stream.end(b)});var items=[{title:"A Nonny Function - Poetry Generating Twitter Bot",key:"nonnyfunc",dataTarget:".nonnyfunc",imageLarge:"img/portfolio/nonnyfunc1215x648.jpg",imageSmall:"img/portfolio/nonnyfunc800x600.jpg",description:"A Twitter bot that tweets poetry using markov strings generated from the works of various poets (Walt Whitman, T.S. Eliot, Rainer Maria Rilke, William Anderson, John Keats, Gerard Manley Hopkins, Emily Dickinson).",tools:"JavaScript, Node, twit.js, RiTa",link:"https://twitter.com/anonnyfunction"},{title:"Cornucopication",key:"corn",dataTarget:".corn",imageLarge:"img/portfolio/corn1500x800.png",imageSmall:"img/portfolio/corn800x600.png",description:"Cornucopication is a site that collects and categorizes events which embody the spirit of small town festivals celebrating locally produced goods or crops, especially those which are edible such as fruits or seafood.",tools:"HTML, CSS, JavaScript, jQuery, Google Maps API",link:"http://www.cornucopication.com"},{title:"Simon Game",key:"simon",dataTarget:".simon",imageLarge:"img/portfolio/simon1500x800.jpg",imageSmall:"img/portfolio/simon800x600.jpg",description:'The Simon Game is a web app that imitates the classic memory game. I completed it while working through the front end development portion of <a href="https://www.freecodecamp.com/" target="_blank">Free Code Camp</a>\'s curriculum.',tools:"HTML, CSS, JavaScript, jQuery",link:"http://codepen.io/1gb/full/dpWymd/"},{title:"MemEater",key:"mem",dataTarget:".mem",imageLarge:"img/portfolio/memEater1500x800.jpg",imageSmall:"img/portfolio/memEater800x600.jpg",description:'MemEater was a collaborative project built in 48 hours for <a href="http://www.arthackday.net/events/erasure" target="_blank">Art Hack Day: Erasure</a>. Visitors were invited to share a memory via a laptop. Their memory would then be displayed via a projector on a wall along with the memories entered by previous participants. If MemEater detected that a word was used in multiple memories, it would black out all instances of that word except for the most recent one. The concept, graphics and design were created by the incredible Illustrator/Architect <a href="http://www.myralara.com/" target="_blank">Myra Lara</a> and I contributed the code. It was on display at Velocity:V2 for the Art Hack Day: Erasure exhibition on September 17th, 2016.',tools:"HTML, CSS, JavaScript, jQuery",link:"http://www.eveworthington.com/memoryEater/"},{title:"Information Dissemination Specialist",key:"ids",dataTarget:".ids",imageLarge:"img/portfolio/ids1500x800.jpg",imageSmall:"img/portfolio/ids800x6002.jpg",description:'Information Dissemination Specialist was built for <a href="http://www.arthackday.net/events/erasure" target="_blank">Art Hack Day: Erasure</a>. Visitors were invited to sit down at a replica office cubicle and take on the role of Information Dissemination Specialist for the FBI. They would then be presented with topics and documents to redact before public release. It was on display at Velocity:V2 for the Art Hack Day: Erasure exhibition on September 17th, 2016.',tools:"HTML, CSS, JavaScript, jQuery",link:"http://www.eveworthington.com/ids/"},{title:"Wage Per Second",key:"wps",dataTarget:".wps",imageLarge:"img/portfolio/wageBank1500x800.png",imageSmall:"img/portfolio/wageBank800x600.png",description:"Wage Per Second is a mobile web app that provides users with a visualization of how much money they are earning. Users can enter their hourly wage via an HTML slider, then the app calculates how much the user makes each second. The user may then start a counter which will grow in real-time to show the user how much they are earning in real-time.",tools:"HTML, CSS, JavaScript, jQuery",link:"http://www.eveworthington.com/piggy-bank/"},{title:"The Summer Rip",key:"tsr",dataTarget:".tsr",imageLarge:"img/portfolio/summerRip1500x800.png",imageSmall:"img/portfolio/summerRip800x600.png",description:'The Summer Rip was a project created for <a href="https://www.name.com/hackthedot" target="_blank">Hack the Dot</a> Seattle: Summer is Dead Edition, which took place in Seattle on August 3, 2016. Hack the Dot is a hackathon in which teams have only 2 hours to contstruct a website for a given domain name. The challenge was to create a website for the domain thesummer.rip and my team decided to go with the concept of summer arriving and wanting to rip your pant legs off into shorts. I contributed the SVG graphics.</p><p>For the GitHub for The Summer Rip and to see the others who contributed, go <a href="https://github.com/brybrophy/the_summer_rip" target="_blank">here</a>.',tools:"HTML, CSS, JavaScript, jQuery, SVG",link:"http://the-summer-rip.surge.sh/"},{title:"Weatherrific!",key:"wea",dataTarget:".wea",imageLarge:"img/portfolio/weatherrific1500x800.png",imageSmall:"img/portfolio/weatherrific800x600.png",description:'Weatherrific! is a web app that detects a user\'s location and shows them the current temperature along with a description of the weather. The user can also search for the weather in other cities. I completed it while working through the front end development portion of <a href="https://www.freecodecamp.com/" target="_blank">Free Code Camp</a>\'s curriculum.',tools:'HTML, CSS, JavaScript, jQuery, HTML 5 Geolocation, AJAX, <a href="http://openweathermap.org/api" target="_blank">OpenWeatherMap API</a>, <a href="https://api.giphy.com/" target="_blank">Giphy API</a>',link:"http://codepen.io/1gb/full/ZQwPOO/"},{title:"Downuts",key:"dow",dataTarget:".dow",imageLarge:"img/portfolio/downuts1500x800.png",imageSmall:"img/portfolio/downuts800x600.png",description:'Downuts is a website for a fictional start-up company which offers donuts with stock information printed on them via icing. This is the first project in a series I call "Half-Baked Start-Up Ideas".',tools:"HTML, CSS, JavaScript, jQuery, Bootstrap",link:"http://www.eveworthington.com/downuts/"},{title:"Marshawn Lynch Random Quote Generator",key:"mar",dataTarget:".mar",imageLarge:"img/portfolio/marshawnQuotes1500x800.png",imageSmall:"img/portfolio/marshawnQuotes800x600.png",description:'The Marshawn Lynch Random Quote Generator is a web app which allows users to recieve snippets of Marshawn Lynch\'s wisdom at a click of a button. I completed it while working through the front end development portion of <a href="https://www.freecodecamp.com/" target="_blank">Free Code Camp</a>\'s curriculum.',tools:"HTML, CSS, JavaScript, Bootstrap",link:"http://codepen.io/1gb/full/YwGyQM/"},{title:"JavaScript Calculator",key:"jsc",dataTarget:".jsc",imageLarge:"img/portfolio/jscalc1500x800.png",imageSmall:"img/portfolio/jscalc800x600.png",description:'The JavaScript Calculator is a web app that functions as a calculator. I completed it while working through the front end development portion of <a href="https://www.freecodecamp.com/" target="_blank">Free Code Camp</a>\'s curriculum.',tools:"HTML, CSS, JavaScript",link:"http://codepen.io/1gb/full/MKpxpN/"}];
